import React from "react";

function Card({image,name,profession,dummy}){
    return(
    <div className="w-52 bg-white rounded-md overflow-hidden">
      <div className="w-full h-32 bg-sky-200">
        <img className="w-full h-full object-cover object-[center_top]" src={image} alt="" />
      </div>
      <div className="w-full p-3">
        <h3 className="text-xl font-semibold">{name}</h3>
        <h5 className="rext-xs">{profession}</h5>
        <button onClick={dummy} className="px-2  bg-blue-500 rounded">
          Add Friend
        </button>
      </div>
    </div>
  );
}

export default Card;
